import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar = () => {
  return (
    <div style={{ textAlign: 'center' }}>
      <h1>WILD CIRCUS BIARRITZ</h1>
      <NavLink style={{ padding: 20 }} to="/inscriptions">
        Inscriptions
      </NavLink>
      <NavLink style={{ padding: 20 }} to="/wild-circus-members">
        Our Team
      </NavLink>
    </div>
  );
};

export default Navbar;
